import MobileMenu from "./MobileMenu";
import { logo, menu, cart, user, wishlist, searchIcon } from "./Index";

const Header = () => {


  return (
    <nav className="bg-whit p-4 relative flex flex-col md:flex-row md:items-center md:justify-between">
    {/* Logo */}
    <div className="w-32 h-14 mb-2 md:mb-0 md:left-0 md:top-0 relative">
    <img
    className="w-32 h-7 justify-center items-center"
    src={logo}
    alt="Logo"
  />
    </div>
    {/* Search Bar */}
    <div className="h-screen w-screen flex justify-center items-center">

    <form
    action="/search" class="max-w-[480px] w-full px-4"
    >
      <input
        className="relative m-0 block w-[10px] min-w-0 flex-auto rounded border border-solid border-neutral-300 bg-transparent bg-clip-padding px-3 py-[0.25rem] text-base font-normal leading-[1.6] text-neutral-700 outline-none transition duration-200 ease-in-out focus:z-[3] focus:border-primary focus:text-neutral-700 focus:shadow-[inset_0_0_0_1px_rgb(59,113,202)] focus:outline-none dark:border-neutral-600 dark:text-neutral-200 dark:placeholder:text-neutral-200 dark:focus:border-primary "
        type="text"
        name="query"
        placeholder="Search..."
      />
    </form> 
   <span className="input-group-text flex items-center whitespace-nowrap rounded px-3 py-1.5 text-center text-base font-normal text-neutral-700 dark:text-neutral-200">
   <img

    src={searchIcon}
    alt="searchIcon"
    type= "search"
    className=" bg-gray-50 border border-gray-300 text-gray-900 text-sm rounded-lg focus:ring-green-700 focus:border-green-700"
  />
   </span>

     </div>



  </nav>
);
};

export default Header;
